import React, { Component } from 'react'

class Posts extends Component {

  render() {
    const postItems = this.state.posts.map(post => (
      <div key={post.id}>
        <p>{post.title}</p>
      </div>
    ))

    return (
      <div>
        <h1>Posts</h1>
        {postItems}
      </div>
    )
  }
}

export default Posts;
